webpackJsonp([328],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-how-to-run-apache-server-on-a-mac-os-x-e-1-captain.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p><a href="http://www.apache.org/">Apache</a> server is pre build on Mac OS X , no need to install 3rd party tools WAMP, LAMP, MAMP AND XAMPP to run Apache server on Mac.</p>\n<p>When you consider run <a href="http://www.apache.org/">Apache</a> server on Mac OS X E1 Captain / OS X Yosemite, it is rather different from it\'s earlier versions. Here you should it from terminal windows, earlier GUI options for tick as webserver from system control window is took off.</p>\n<p>Type on your terminal window:</p>\n<pre><code>httpd -v\n</code></pre>\n<p>It\'s give the server version and build date.</p>\n<p>Here http stands for Hypertext Transfer Protocol d stands for Daemon which is a software program for using multi tasking also uses on Mac OS X. <code>httpd</code> is the Apache HyperText Transfer Protocol (HTTP) server program. It is designed to be run as a standalone daemon process. Type</p>\n<pre><code>sudo apachectl start\n</code></pre>\n<p>on your terminal window and go to your browser and type <code>http://localhost</code> you will get, <code>It works!</code> on your browser.</p>',frontmatter:{title:"How To Run Apache Server On A Mac Os X E1 Captain",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/how-to-run-apache-server-on-a-mac-os-x-e1-captain/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/how-to-run-apache-server-on-a-mac-os-x-e1-captain/"}}}});
